import React from "react";
import logo from "./Chris-Hailey.png";

function Nav() {
  return (
    <header className="flex-row px-1">
      <h2>
        <a href="/">
          <p>Nav</p>
          <img src={logo} />
        </a>
      </h2>
    </header>
  );
}

export default Nav;
